\u5C0F\u9876\u5806\uFF1A\u6BCF\u4E2A\u8282\u70B9\u7684\u503C\u90FD\u5C0F\u4E8E\u6216\u7B49\u4E8E\u5176\u5B50\u8282\u70B9\u7684\u503C\uFF0C\u5728\u5806\u6392\u5E8F\u7B97\u6CD5\u4E2D\u7528\u4E8E\u964D\u5E8F\u6392\u5217\uFF1B`,paraId:1,tocIndex:0},{value:"\u5806\u6392\u5E8F\u7684\u5E73\u5747\u65F6\u95F4\u590D\u6742\u5EA6\u4E3A \u039F(nlogn)\u3002",paraId:2,tocIndex:0},{value:"\u56FE\u7247\u6765\u6E90\uFF1A",paraId:3,tocIndex:0},{value:"https://www.runoob.com/w3cnote/heap-sort.html",paraId:3,tocIndex:0},{value:"\u5229\u7528\u5806\u6392\u5E8F\u67E5\u627E\u6570\u7EC4 nums \u4E2D\u524D k \u5927\u7684\u503C (LeetCode 703)\uFF0C\u5E76\u652F\u6301\u6DFB\u52A0\u5143\u7D20\uFF1A",paraId:4,tocIndex:0},{value:"nums = [1, 2, 3, 4, 5, 6, 7, 8]",paraId:5,tocIndex:0},{value:`// \u6784\u5EFA\u4E00\u4E2A\u6700\u5927\u5806
const KthLargest = function (k, nums) {
  this.k = k;
  this.heap = new MaxHeap();
  for (const x of nums) {
    this.add(x);
  }
};

// \u5165\u5806\u64CD\u4F5C
KthLargest.prototype.add = function (val) {
  this.heap.offer(val);
  if (this.heap.size() > this.k) {
    this.heap.poll();
  }
  return this.heap.peek();
};

// \u6700\u5927\u5806\u7C7B
class MaxHeap {
  constructor(data = []) {
    this.data = data;
    this.comparator = (a, b) => a - b;
    this.heapify();
  }

  heapify() {
    // \u521D\u59CB\u5316\u65F6\u82E5\u4E0D\u4F20data\uFF0Cheapify\u4E0D\u6267\u884C
    if (this.size() < 2) return;
    for (let i = 1; i < this.size(); i++) {
      this.bubbleUp(i);
    }
  }

  // \u83B7\u53D6\u7B2Ck\u5927\u5143\u7D20
  peek() {
    if (this.size() === 0) return null;
    return this.data[0];
  }

  // \u5411\u5BF9\u5C3E\u63A8\u5165\u5143\u7D20\uFF0C\u5E76\u505A\u4E00\u6B21\u63D0\u5347\u64CD\u4F5C
  offer(value) {
    this.data.push(value);
    this.bubbleUp(this.size() - 1);
  }

  // \u8F6E\u8BE2\u4E00\u904D\uFF1A\u53EA\u4FDD\u7559\u524Dk\u7684\uFF0C\u53EF\u4EE5\u7406\u89E3\u4E3A\u795B\u9664\u4E86\u6700\u5927\u5143\u7D20\u540E\u518D\u6B21\u5806\u5316
  poll() {
    if (this.size() === 0) {
      return null;
    }
    const result = this.data[0];
    const last = this.data.pop();
    if (this.size() !== 0) {
      this.data[0] = last;
      this.bubbleDown(0);
    }
    return result;
  }

  // \u6BD4\u8F83\u5F53\u524D\u7D22\u5F15\u7684\u8282\u70B9\u548C\u5176\u5B50\u8282\u70B9\u5927\u5C0F\uFF0C\u5B50\u8282\u70B9\u5C0F\u7684\u8981\u4EA4\u6362\uFF0C\u76F4\u5230\u6839\u8282\u70B9\u7ED3\u675F
  bubbleUp(index) {
    while (index > 0) {
      const parentIndex = (index - 1) >> 1; // \u9664\u4EE52\uFF0C\u83B7\u53D6\u5B8C\u5168\u4E8C\u53C9\u6811\u7684\u7236\u8282\u70B9\u7684\u7D22\u5F15
      if (this.comparator(this.data[index], this.data[parentIndex]) < 0) {
        this.swap(index, parentIndex);
        index = parentIndex;
      } else {
        break;
      }
    }
  }

  bubbleDown(index) {
    const lastIndex = this.size() - 1;
    while (true) {
      const leftIndex = index * 2 + 1;
      const rightIndex = index * 2 + 2;
      let findIndex = index;
      if (
        leftIndex <= lastIndex &&
        this.comparator(this.data[leftIndex], this.data[findIndex]) < 0
      ) {
        findIndex = leftIndex;
      }
      if (
        rightIndex <= lastIndex &&
        this.comparator(this.data[rightIndex], this.data[findIndex]) < 0
      ) {
        findIndex = rightIndex;
      }
      if (index !== findIndex) {
        this.swap(index, findIndex);
        index = findIndex;
      } else {
        break;
      }
    }
  }

  // \u4EA4\u6362data\u4E2D\u4E24\u4E2A\u4E0B\u6807\u7684\u5143\u7D20
  swap(index1, index2) {
    [this.data[index1], this.data[index2]] = [
      this.data[index2],
      this.data[index1],
    ];
  }

  size() {
    return this.data.length;
  }
}
